script.source:
{
    "highlight" : {
        "fields" : {
            "name" : {},
            "description" : {}
        }
    },
    "_source": {{#toJson}}fetchSource{{/toJson}},
    {{#sort}}
        "sort": {{#toJson}}sortVal{{/toJson}},
    {{/sort}}
    "from": {{from}},
    "size": {{size}},
    "query": {
        "bool": {
            {{#must}}
            "must": [
                {
                    "multi_match": {
                        "query": "{{searchTerm}}",
                        "fields": {{#toJson}}searchFieldsWithBoost{{/toJson}},
                        "type": {{#should}}"best_fields"{{/should}}{{^should}}"phrase"{{/should}},
                        "operator": "OR",
                        "slop": 0,
                        "prefix_length": 0,
                        "max_expansions": 50,
                        "lenient": false,
                        "zero_terms_query": "NONE",
                        "boost": 1.0
                    }
                }
            ],
            {{/must}}
            "filter": [
                {{#filters}}
                {
                    "bool":{
                    "should": [
                        {{#filterItem}}
                        {{#filterItemComma}},{{/filterItemComma}}
                        {
                            "bool":{
                            "boost": 1
                            {{#mustFilter}}
                                ,"must":[
                                    {
                                    "exists": {
                                        "field": "name"
                                    }
                                },
                                {
                                    "term":{
                                        "isSearchable": true
                                    }
                                }
                                {{#filterMimeType}}
                                    ,{
                                        "terms": {
                                            "mimeType": {{#toJson}}filterMimeTypeVal{{/toJson}}
                                        }
                                    }
                                {{/filterMimeType}}
                                {{#filterIsInIntranet}}
                                    ,{
                                        "terms": {
                                            "isInIntranet": {{#toJson}}filterIsInIntranetVal{{/toJson}}
                                        }
                                    }
                                {{/filterIsInIntranet}}
                                {{#filterInstanceCatalog}}
                                    ,{
                                        "terms": {
                                            "instanceCatalog": {{#toJson}}filterInstanceCatalogVal{{/toJson}}
                                        }
                                    }
                                {{/filterInstanceCatalog}}
                                {{#filterExclusiveContent}}
                                    ,{
                                        "terms": {
                                            "exclusiveContent": {{#toJson}}filterExclusiveContentVal{{/toJson}}
                                        }
                                    }
                                {{/filterExclusiveContent}}
                                {{#filterCollectionsId}}
                                    ,{
                                        "nested": {
                                            "path": "collections",
                                            "query": {
                                                "terms": {
                                                    "collections.identifier": {{#toJson}}filterCollectionsIdVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterCollectionsId}}
                                {{#filterCollectionsName}}
                                    ,{
                                        "nested": {
                                            "path": "collections",
                                            "query": {
                                                "terms": {
                                                    "collections.name": {{#toJson}}filterCollectionsNameVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterCollectionsName}}
                                {{#filterChildrenId}}
                                    ,{
                                        "nested": {
                                            "path": "children",
                                            "query": {
                                                "terms": {
                                                    "children.identifier": {{#toJson}}filterChildrenIdVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterChildrenId}}
                                {{#filterChildrenName}}
                                    ,{
                                        "nested": {
                                            "path": "children",
                                            "query": {
                                                "terms": {
                                                    "children.name": {{#toJson}}filterChildrenNameVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterChildrenName}}
                                {{#filterCuratedTags}}
                                    ,{
                                        "terms": {
                                            "curatedTags.keyword": {{#toJson}}filterCuratedTagsVal{{/toJson}},
                                            "boost": 1.0
                                        }
                                    }
                                {{/filterCuratedTags}}
                                {{#filterIdentifier}}
                                    ,{
                                        "ids": {
                                            "values": {{#toJson}}filterIdentifierVal{{/toJson}}
                                        }
                                    }
                                {{/filterIdentifier}}
                                {{#filterLabels}}
                                    ,{
                                        "terms": {
                                            "labels": {{#toJson}}filterLabelsVal{{/toJson}},
                                            "boost": 1.0
                                        }
                                    }
                                {{/filterLabels}}
                                {{#filterSkills}}
                                    ,{
                                        "nested":{
                                            "path":"skills",
                                            "query":{
                                                "terms": {
                                                    "skills.skill": {{#toJson}}filterSkillsVal{{/toJson}},
                                                    "boost": 1.0
                                                }
                                            }
                                        }
                                    }
                                {{/filterSkills}}
                                {{#filterJobProfile}}
                                    ,{
                                        "terms": {
                                            "jobProfile": {{#toJson}}filterJobProfileVal{{/toJson}},
                                            "boost": 1.0
                                        }
                                    }
                                {{/filterJobProfile}}
                                {{#filterRegion}}
                                    ,{
                                        "terms": {
                                            "region": {{#toJson}}filterRegionVal{{/toJson}},
                                            "boost": 1.0
                                        }
                                    }
                                {{/filterRegion}}
                                {{#filterInstanceCatalog}}
                                    ,{
                                        "terms": {
                                            "instanceCatalog": {{#toJson}}filterInstanceCatalogVal{{/toJson}}
                                        }
                                    }
                                {{/filterInstanceCatalog}}
                                {{#filterExclusiveContent}}
                                    ,{
                                        "terms": {
                                            "exclusiveContent": {{#toJson}}filterExclusiveContentVal{{/toJson}}
                                        }
                                    }
                                {{/filterExclusiveContent}}
                                {{#filterIsRejected}}
                                    ,{
                                        "terms": {
                                            "isRejected": {{#toJson}}filterIsRejectedVal{{/toJson}}
                                        }
                                    }
                                {{/filterIsRejected}}
                                {{#filterCatalogPathsIds}}
                                    ,{
                                        "terms": {
                                            "catalogPathsIds": {{#toJson}}filterCatalogPathsIdsVal{{/toJson}}
                                        }
                                    }
                                {{/filterCatalogPathsIds}}
                                {{#filterUnit}}
                                    ,{
                                        "terms": {
                                            "unit": {{#toJson}}filterUnitVal{{/toJson}}
                                        }
                                    }
                                {{/filterUnit}}
                                {{#filterStatus}}
                                    ,{
                                        "terms": {
                                            "status": {{#toJson}}filterStatusVal{{/toJson}}
                                        }
                                    }
                                {{/filterStatus}}
                                {{#filterCreatorContacts}}
                                    ,{
                                        "nested": {
                                            "path": "creatorContacts",
                                            "query": {
                                                "terms": {
                                                    "creatorContacts.id": {{#toJson}}filterCreatorContactsVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterCreatorContacts}}
                                {{#filterTrackContacts}}
                                    ,{
                                        "nested": {
                                            "path": "trackContacts",
                                            "query": {
                                                "terms": {
                                                    "trackContacts.id": {{#toJson}}filterTrackContactsVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterTrackContacts}}
                                {{#filterPublisherDetails}}
                                    ,{
                                        "nested": {
                                            "path": "publisherDetails",
                                            "query": {
                                                "terms": {
                                                    "publisherDetails.id": {{#toJson}}filterPublisherDetailsVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterPublisherDetails}}
                                {{#filterIsExternal}}
                                    ,{
                                        "terms": {
                                            "isExternal": {{#toJson}}filterIsExternalVal{{/toJson}}
                                        }
                                    }
                                {{/filterIsExternal}}
                                {{#filterLearningMode}}
                                    ,{
                                        "terms": {
                                            "learningMode": {{#toJson}}filterLearningModeVal{{/toJson}}
                                        }
                                    }
                                {{/filterLearningMode}}
                                {{#isStandAlone}}
                                    ,{
                                        "term": {
                                            "isStandAlone": {{isStandAloneVal}}
                                        }
                                    }
                                {{/isStandAlone}}
                                {{#filterComplexityLevel}}
                                    ,{
                                        "terms": {
                                            "complexityLevel": {{#toJson}}filterComplexityLevelVal{{/toJson}}
                                        }
                                    }
                                {{/filterComplexityLevel}}
                                {{#filterContentType}}
                                    ,{
                                        "terms": {
                                            "contentType": {{#toJson}}filterContentTypeVal{{/toJson}}
                                        }
                                    }
                                {{/filterContentType}}
                                {{#filterDuration}}
                                    ,{
                                        "bool": {
                                            "should": [
                                                {{#filterDurationItem}}
                                                    {
                                                        "range": {
                                                            "duration": {
                                                                "from": {{filterDurationItemGte}},
                                                                "to": {{filterDurationItemLte}},
                                                                "include_lower": true,
                                                                "include_upper": false
                                                            }
                                                        }
                                                    }
                                                    {{#filterDurationItemComma}},{{/filterDurationItemComma}}
                                                {{/filterDurationItem}}
                                            ],

                                            "adjust_pure_negative": true
                                        }
                                    }
                                {{/filterDuration}}
                                {{#filterFileType}}
                                    ,{
                                        "terms": {
                                            "fileType": {{#toJson}}filterFileTypeVal{{/toJson}}
                                        }
                                    }
                                {{/filterFileType}}
                                {{#filterLastUpdatedOn}}
                                    ,{
                                        "range": {
                                            "lastUpdatedOn": {
                                                "from": "{{filterLastUpdatedOnGte}}",
                                                "to": "{{filterLastUpdatedOnLte}}",
                                                "include_lower": true,
                                                "include_upper": true
                                            }
                                        }
                                    }
                                {{/filterLastUpdatedOn}}
                                {{#filterResourceCategory}}
                                    ,{
                                        "terms": {
                                            "resourceCategory": {{#toJson}}filterResourceCategoryVal{{/toJson}}
                                        }
                                    }
                                {{/filterResourceCategory}}
                                {{#filterResourceType}}
                                    ,{
                                        "terms": {
                                            "resourceType": {{#toJson}}filterResourceTypeVal{{/toJson}}
                                        }
                                    }
                                {{/filterResourceType}}
                                {{#filterSourceShortName}}
                                    ,{
                                        "terms": {
                                            "sourceShortName.keyword": {{#toJson}}filterSourceShortNameVal{{/toJson}}
                                        }
                                    }
                                {{/filterSourceShortName}}
                                {{#filterCatalogPaths}}
                                    ,{
                                        "terms": {
                                            "catalogPaths.keyword": {{#toJson}}filterCatalogPathsVal{{/toJson}}
                                        }
                                    }
                                {{/filterCatalogPaths}}
                                {{#filterKeywords}}
                                    ,{
                                        "terms": {
                                            "keywords.keyword": {{#toJson}}filterKeywordsVal{{/toJson}}
                                        }
                                    }
                                {{/filterKeywords}}
                                {{#accessControlEnabled}}
                                    ,{
                                        "terms": {
                                            "accessPaths": {{#toJson}}accessPaths{{/toJson}}
                                        }
                                    },
                                    {
                                        "term": {
                                            "rootOrg": "{{rootOrg}}"
                                        }
                                    },
                                    {
                                        "nested": {
                                            "query": {
                                                "bool": {
                                                    "must": [
                                                        {
                                                            "terms": {
                                                                "org.org": {{#toJson}}org{{/toJson}}
                                                            }
                                                        },
                                                        {
                                                            "range": {
                                                                "org.validTill": {
                                                                    "from": "now",
                                                                    "to": null,
                                                                    "include_lower": true,
                                                                    "include_upper": true
                                                                }
                                                            }
                                                        }
                                                    ],

                                                    "adjust_pure_negative": true,
                                                    "boost": 1.0
                                                }
                                            },
                                            "path": "org",
                                            "ignore_unmapped": false,
                                            "score_mode": "avg"
                                        }
                                    }
                                {{/accessControlEnabled}}
                                    ]
                            {{/mustFilter}}
                            {{#mustNotFilter}}
                                ,"must_not":[
                                {
                                    "term":{
                                        "isSearchable": false
                                    }
                                }
                                {{#filterNotMimeType}}
                                    ,{
                                        "terms": {
                                            "mimeType": {{#toJson}}filterNotMimeTypeVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotMimeType}}
                                {{#filterNotIsInIntranet}}
                                    ,{
                                        "terms": {
                                            "isInIntranet": {{#toJson}}filterNotIsInIntranetVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotIsInIntranet}}
                                {{#filterNotInstanceCatalog}}
                                    ,{
                                        "term": {
                                            "instanceCatalog": {{#toJson}}filterNotInstanceCatalogVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotInstanceCatalog}}
                                {{#filterNotExclusiveContent}}
                                    ,{
                                        "terms": {
                                            "exclusiveContent": {{#toJson}}filterNotExclusiveContentVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotExclusiveContent}}
                                {{#filterNotCollectionsId}}
                                    {
                                        "nested": {
                                            "path": "collections",
                                            "query": {
                                                "terms": {
                                                    "collections.identifier": {{#toJson}}filterNotCollectionsIdVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterNotCollectionsId}}
                                {{#filterNotCollectionsName}}
                                    {
                                        "nested": {
                                            "path": "collections",
                                            "query": {
                                                "terms": {
                                                    "collections.name": {{#toJson}}filterNotCollectionsNameVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterNotCollectionsName}}
                                {{#filterNotChildrenId}}
                                    {
                                        "nested": {
                                            "path": "children",
                                            "query": {
                                                "terms": {
                                                    "children.identifier": {{#toJson}}filterNotChildrenIdVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterNotChildrenId}}
                                {{#filterNotChildrenName}}
                                    {
                                        "nested": {
                                            "path": "children",
                                            "query": {
                                                "terms": {
                                                    "children.name": {{#toJson}}filterNotChildrenNameVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterNotChildrenName}}
                                {{#filterNotCuratedTags}}
                                    ,{
                                        "terms": {
                                            "curatedTags.keyword": {{#toJson}}filterNotCuratedTagsVal{{/toJson}},
                                            "boost": 1.0
                                        }
                                    }
                                {{/filterNotCuratedTags}}
                                {{#filterNotIdentifier}}
                                    ,{
                                        "ids": {
                                            "values": {{#toJson}}filterNotIdentifierVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotIdentifier}}
                                {{#filterNotLabels}}
                                    ,{
                                        "terms": {
                                            "labels": {{#toJson}}filterNotLabelsVal{{/toJson}},
                                            "boost": 1.0
                                        }
                                    }
                                {{/filterNotLabels}}
                                {{#filterNotSkills}}
                                    ,{
                                        "nested":{
                                            "path":"skills",
                                            "query":{
                                                "terms": {
                                                    "skills.skill": {{#toJson}}filterNotSkillsVal{{/toJson}},
                                                    "boost": 1.0
                                                }
                                            }
                                        }
                                    }
                                {{/filterNotSkills}}
                                {{#filterNotJobProfile}}
                                    ,{
                                        "terms": {
                                            "jobProfile": {{#toJson}}filterNotJobProfileVal{{/toJson}},
                                            "boost": 1.0
                                        }
                                    }
                                {{/filterNotJobProfile}}
                                {{#filterNotRegion}}
                                    ,{
                                        "terms": {
                                            "region": {{#toJson}}filterNotRegionVal{{/toJson}},
                                            "boost": 1.0
                                        }
                                    }
                                {{/filterNotRegion}}
                                {{#filterNotInstanceCatalog}}
                                    ,{
                                        "term": {
                                            "instanceCatalog": {{#toJson}}filterNotInstanceCatalogVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotInstanceCatalog}}
                                {{#filterNotExclusiveContent}}
                                    ,{
                                        "terms": {
                                            "exclusiveContent": {{#toJson}}filterNotExclusiveContentVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotExclusiveContent}}
                                {{#filterNotIsRejected}}
                                    ,{
                                        "terms": {
                                            "isRejected": {{#toJson}}filterNotIsRejectedVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotIsRejected}}
                                {{#filterNotCatalogPathsIds}}
                                    ,{
                                        "terms": {
                                            "catalogPathsIds": {{#toJson}}filterNotCatalogPathsIdsVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotCatalogPathsIds}}
                                {{#filterNotUnit}}
                                    ,{
                                        "terms": {
                                            "unit": {{#toJson}}filterNotUnitVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotUnit}}
                                {{#filterNotStatus}}
                                    ,{
                                        "terms": {
                                            "status": {{#toJson}}filterNotStatusVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotStatus}}
                                {{#filterNotCreatorContacts}}
                                    ,{
                                        "nested": {
                                            "path": "creatorContacts",
                                            "query": {
                                                "terms": {
                                                    "creatorContacts.id": {{#toJson}}filterNotCreatorContactsVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterNotCreatorContacts}}
                                {{#filterNotTrackContacts}}
                                    ,{
                                        "nested": {
                                            "path": "trackContacts",
                                            "query": {
                                                "terms": {
                                                    "trackContacts.id": {{#toJson}}filterNotTrackContactsVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterNotTrackContacts}}
                                {{#filterNotPublisherDetails}}
                                    ,{
                                        "nested": {
                                            "path": "publisherDetails",
                                            "query": {
                                                "terms": {
                                                    "publisherDetails.id": {{#toJson}}filterNotPublisherDetailsVal{{/toJson}}
                                                }
                                            }
                                        }
                                    }
                                {{/filterNotPublisherDetails}}
                                {{#filterNotIsExternal}}
                                    ,{
                                        "terms": {
                                            "isExternal": {{#toJson}}filterNotIsExternalVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotIsExternal}}
                                {{#filterNotLearningMode}}
                                    ,{
                                        "terms": {
                                            "learningMode": {{#toJson}}filterNotLearningModeVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotLearningMode}}
                                {{#isStandAlone}}
                                    ,{
                                        "term": {
                                            "isStandAlone": {{isStandAloneVal}}
                                        }
                                    }
                                {{/isStandAlone}}
                                {{#filterNotComplexityLevel}}
                                    ,{
                                        "terms": {
                                            "complexityLevel": {{#toJson}}filterNotComplexityLevelVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotComplexityLevel}}
                                {{#filterNotContentType}}
                                    ,{
                                        "terms": {
                                            "contentType": {{#toJson}}filterNotContentTypeVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotContentType}}
                                {{#filterNotDuration}}
                                    ,{
                                        "bool": {
                                            "should": [
                                                {{#filterNotDurationItem}}
                                                    {
                                                        "range": {
                                                            "duration": {
                                                                "from": {{filterNotDurationItemGte}},
                                                                "to": {{filterNotDurationItemLte}},
                                                                "include_lower": true,
                                                                "include_upper": false
                                                            }
                                                        }
                                                    }
                                                    {{#filterNotDurationItemComma}},{{/filterNotDurationItemComma}}
                                                {{/filterNotDurationItem}}
                                            ],

                                            "adjust_pure_negative": true
                                        }
                                    }
                                {{/filterNotDuration}}
                                {{#filterNotFileType}}
                                    ,{
                                        "terms": {
                                            "fileType": {{#toJson}}filterNotFileTypeVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotFileType}}
                                {{#filterNotLastUpdatedOn}}
                                    ,{
                                        "range": {
                                            "lastUpdatedOn": {
                                                "from": "{{filterNotLastUpdatedOnGte}}",
                                                "to": "{{filterNotLastUpdatedOnLte}}",
                                                "include_lower": true,
                                                "include_upper": true
                                            }
                                        }
                                    }
                                {{/filterNotLastUpdatedOn}}
                                {{#filterNotResourceCategory}}
                                    ,{
                                        "terms": {
                                            "resourceCategory": {{#toJson}}filterNotResourceCategoryVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotResourceCategory}}
                                {{#filterNotResourceType}}
                                    ,{
                                        "terms": {
                                            "resourceType": {{#toJson}}filterNotResourceTypeVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotResourceType}}
                                {{#filterNotSourceShortName}}
                                    ,{
                                        "terms": {
                                            "sourceShortName.keyword": {{#toJson}}filterNotSourceShortNameVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotSourceShortName}}
                                {{#filterNotCatalogPaths}}
                                    ,{
                                        "terms": {
                                            "catalogPaths.keyword": {{#toJson}}filterNotCatalogPathsVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotCatalogPaths}}
                                {{#filterNotKeywords}}
                                    ,{
                                        "terms": {
                                            "keywords.keyword": {{#toJson}}filterNotKeywordsVal{{/toJson}}
                                        }
                                    }
                                {{/filterNotKeywords}}
                                    ]
                            {{/mustNotFilter}}
                            } 
                        }
                        {{/filterItem}}
                        ]
                    }
                }
                {{/filters}}
                ]
            {{#should}}
                , "minimum_should_match": 1
                ,"should": [
                  {
                    "multi_match": {
                        "query": "{{searchTerm}}",
                        "fields": {{#toJson}}searchFieldsWithBoost{{/toJson}},
                        "type": {{#should}}"best_fields"{{/should}}{{^should}}"phrase"{{/should}},
                        "operator": "OR",
                        "slop": 0,
                        "prefix_length": 0,
                        "max_expansions": 50,
                        "lenient": false,
                        "zero_terms_query": "NONE",
                        "boost": 1.0
                    }
                },
                    {
                        "match_phrase_prefix": {
                            "name": {
                                "query": "{{searchTerm}}",

                                "slop": 3,
                                "boost": 1.0
                            }
                        }
                    },
                    {
                        "match_phrase_prefix": {
                            "description": {
                                "query": "{{searchTerm}}",

                                "slop": 3,
                                "boost": 1.0
                            }
                        }
                    },
                    {
                        "match_phrase_prefix": {
                            "concepts.name": {
                                "query": "{{searchTerm}}",

                                "slop": 3,
                                "boost": 1.0
                            }
                        }
                    },
                    {
                        "match_phrase_prefix": {
                            "keywords": {
                                "query": "{{searchTerm}}",

                                "slop": 3,
                                "boost": 1.0
                            }
                        }
                    },
                    {
                        "match_phrase_prefix": {
                            "childrenTitle": {
                                "query": "{{searchTerm}}",

                                "slop": 3,
                                "boost": 1.0
                            }
                        }
                    },
                    {
                        "match_phrase_prefix": {
                            "childrenDescription": {
                                "query": "{{searchTerm}}",

                                "slop": 3,
                                "boost": 1.0
                            }
                        }
                    },
                    {
                        "match_phrase_prefix": {
                            "sourceShortName": {
                                "query": "{{searchTerm}}",

                                "slop": 3,
                                "boost": 1.0
                            }
                        }
                    },
					{
                        "match_phrase_prefix": {
                            "sourceName": {
                                "query": "{{searchTerm}}",

                                "slop": 3,
                                "boost": 1.0
                            }
                        }
                    }
                ]
            {{/should}}
            ,
            "adjust_pure_negative": true
        }
    }
    ,"aggregations": {
        "TotalAggs": {
            "global": {},
            "aggregations": {
                "concepts_aggs": {
                    "filter": {
                        "bool": {
                            {{#must}}
                                "must": [
                                    {
                                        "multi_match": {
                                            "query": "{{searchTerm}}",
                                            "fields": {{#toJson}}searchFieldsWithBoost{{/toJson}},
                                            "type": {{#should}}"best_fields"{{/should}}{{^should}}"phrase"{{/should}},
                                            "operator": "OR",
                                            "slop": 0,
                                            "prefix_length": 0,
                                            "max_expansions": 50,
                                            "lenient": false,
                                            "zero_terms_query": "NONE",
                                            "boost": 1.0
                                        }
                                    }
                                ],
                            {{/must}}
                            "filter": [
                                {{#filters}}
                                {
                                    "bool":{
                                    "should": [
                                        {{#filterItem}}
                                        {{#filterItemComma}},{{/filterItemComma}}
                                        {
                                            "bool":{
                                            "boost": 1
                                            {{#mustFilter}}
                                                ,"must":[
                                                    {
                                                    "exists": {
                                                        "field": "name"
                                                    }
                                                },
                                                {
                                                    "term":{
                                                        "isSearchable": true
                                                    }
                                                }
                                                {{#filterMimeType}}
